import React from "react";
import { Box, AppBar, ThemeProvider, Typography, createTheme } from "@mui/material";
// import { pageTheme } from "./assets/PageTheme";

import CssBaseline from '@mui/material/CssBaseline';

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

function App() {
  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <Box>
        <AppBar sx={{ p: 2 }}>
          <Typography variant="h4" component="div" sx={{ p: 2 }}>
            Audio Player for Streamed Content
          </Typography>
        </AppBar>
      </Box>
    </ThemeProvider>
  );
}

export default App;
